import React from "react";
import LogoPresintation from "./LogoPresintation";

function Logo({ logoText }) {
  return (
    <h1 id="logo" className="navbar-brand mid-bold light m-0">
      <LogoPresintation logoText={logoText} />
    </h1>
  );
}

export default Logo;
